import React from 'react'
import { Form, Input, DatePicker, Select, Button } from 'antd'
import local from 'antd/es/date-picker/locale/th_TH'
import { AnimalDataRegit } from '../../api/AnimalApis'

class AnimalRegiterComponent extends React.Component {

    constructor() {
        super()
        this.state = {
            animalType: [],
            animalSex: []
        }
    }

    async componentDidMount() {
        let dataRegit = await AnimalDataRegit()

        console.log(dataRegit)
        this.setState({
            animalType: [dataRegit.AnimalType],
            animalSex: [dataRegit.AnimalSex]
        })
    }

    onFinish = (e) => {
        let value = {
            ...e,
            'birthDay': e['birthDay'].format('YYYY-MM-DD')
        }
        console.log(value)
    }

    render() {

        return (
            <div>
                <Form
                    wrapperCol={{
                        span: 10
                    }}
                    labelCol={{
                        span: 4
                    }}
                    onFinish={this.onFinish}
                >
                    <Form.Item
                        label="ชนิดสัตว์ป่า"
                        name="animalType"
                    >
                        <Select>
                            {this.state.AnimalType.map((a, b) =>
                                (
                                    <Select.Option key={b} value={a.animal_sex_id}>{a.animal_sex_description}</Select.Option>
                                )
                            )}
                        </Select>
                    </Form.Item>
                    <Form.Item
                        label="ชื่อเล่น"
                        name="nickName"
                    >
                        <Input />
                    </Form.Item>
                    <Form.Item
                        label="ชื่อจริง"
                        name="fName"
                    >
                        <Input />
                    </Form.Item>
                    <Form.Item
                        label="นามสกุล"
                        name="lName"
                    >
                        <Input />
                    </Form.Item>
                    <Form.Item
                        label="วันเกิด"
                        name="birthDay"
                    >
                        <DatePicker
                            locale={local}
                        />
                    </Form.Item>
                    <Form.Item
                        label="เพศ"
                        name="animalSex"
                    >
                        <Select>
                            <Select.Option>{'ตัวผู้'}</Select.Option>
                        </Select>
                    </Form.Item>
                    <Form.Item
                        wrapperCol={{ offset: 4, span: 10 }}
                    >
                        <Button
                            htmlType="submit"
                            type="primary"
                            block
                        >
                            {'บันทึก'}
                        </Button>
                    </Form.Item>
                </Form>
            </div>
        )

    }
}

export default AnimalRegiterComponent
